# Programma om het aantal nucleotiden te tellen.
# Naast het tellen van de nucleotiden rekent het programma
# ook het GC-percentage uit van de ingegeven sequentie.
print("/----------------------------------\\")
print("|     Rekenhulp GC-percentage      |")
print("| Cyclin dependent kinase 1 - CDK1 |")
print("\----------------------------------/\n")



# RNA-sequenties.
rna_bos_taurus = ""
rna_caenorhabditis_elegans = ""
rna_drosophila_melanogaster = ""
rna_homo_sapiens = ""
