# Keuzenlijst weergeven.
print("Maak een keuze uit de volgende nummers:")
print(" 1 - Bos taurus (koe)")
print(" 2 - Caenorhabditis elegans (rondworm)")
print(" 3 - Drosophila melanogaster (fruitvlieg)")
print(" 4 - Homo sapiens (mens)")
print(" 5 - Pan paniscus (bonobo --> mensaap)")



# Keuze gebruiker ophalen.
keuze = input("\n:> ")

# Ingegeven keuzen verifiëren.
if keuze.isnumeric() != True: print("Geef een nummer op uit de lijst!")
elif int(keuze) > 5: print("Geef een nummer op uit de lijst!")
elif int(keuze) < 1: print("Geef een nummer op uit de lijst!")
else:
    keuze_correct = int(keuze)
    print("Keuze verwerken..\n\n")


    # Kijken welk nummer er is ingegeven.
    # Bos taurus (koe).
    if keuze_correct == 1:
        print("Gemaakte keuze: Bos taurus (koe)")

        # Tellen van het geheel, G- en C-nucleotiden tellen en GC-percentage uitrekenen.
        bos_taurus_karakters = rna_bos_taurus.count("")
        bos_taurus_g = rna_bos_taurus.count("G")
        bos_taurus_c = rna_bos_taurus.count("C")
        bos_taurus_percentage = ((bos_taurus_g + bos_taurus_c) / bos_taurus_karakters) * 100
        bos_taurus_genoom = 41.8685

        # Weergeven informatie.
        print("Totale lengte sequentie: " + str(bos_taurus_karakters))
        print("Aantal \"G\": " + str(bos_taurus_g))
        print("Aantal \"C\": " + str(bos_taurus_c))
        print("GC-percentage: " + str(bos_taurus_percentage) + "%")
        print("GC-percentage genoom: " + str(bos_taurus_genoom) + "%\n\n\n")


